use std::collections::HashMap;

struct TreeNode {
    children: HashMap<String, Box<TreeNode>>,
    terminal: bool,
}

impl TreeNode {
    fn insert(&mut self, ss: &[&str]) {
        if ss.is_empty() {
            return;
        }
        let s = ss[0];
        let mut terminal = false;
        if ss.len() == 1 {
            terminal = true;
        }
        if let Some(cur) = self.children.get_mut(s) {
            if cur.terminal {
                return;
            }
            if terminal {
                cur.terminal = true;
            } else {
                cur.insert(&ss[1..]);
            }
        } else {

            let cur = self.children.entry(s.to_string()).or_insert(Box::new(TreeNode{
                children: HashMap::new(),
                terminal,
            }));
            if !terminal {
                cur.insert(&ss[1..]);
            }
        }
    }
    fn get_dir(&self, cur: &mut Vec<String>, ans: &mut Vec<String>) {
        self.children.iter().for_each(|(k,v)| {
            cur.push(k.clone());
            if v.terminal {
                ans.push("/".to_string() + cur.join("/").as_str());
                cur.pop();
            } else {
                v.get_dir(cur, ans);
                cur.pop();
            }
        });
    }
}

impl Solution {
    pub fn remove_subfolders(folder: Vec<String>) -> Vec<String> {
        if folder.is_empty() {
            return vec![];
        }
        let n = folder.len();
        if n == 1 {
            return folder;
        }
        let mut root = TreeNode{
            children: HashMap::new(),
            terminal: false,
        };
        for dir in folder {
            let d: Vec<_> = dir.trim_start_matches("/").split("/").collect();
            root.insert(&d[..]);
        }
        let mut ans = vec![];
        let mut cur = vec![];
        root.get_dir(&mut cur, &mut ans);
        ans
    }
}

